import React from 'react'
import './index.css'

const Footer=()=>{
    return(
        <div className='gpt3-footer section-padding'>
            <div className='gpt3-footer-heading'>
                <h2 className='gradient-text'></h2>
            </div>
        </div>
    )
}
export default Footer
